import { Component, Input, Output, EventEmitter } from '@angular/core';
import { Router } from '@angular/router';
import { AuthService } from '../../services/auth.service';

@Component({
  selector: 'app-sidebar',
  templateUrl: './sidebar.component.html',
  styleUrls: ['./sidebar.component.css']
})
export class SidebarComponent {
  private _isOpen = false;
  
  @Input() 
  set isOpen(value: boolean) {
    console.log('ðŸ”„ Sidebar isOpen changed to:', value);
    this._isOpen = value;
  }
  
  get isOpen(): boolean {
    return this._isOpen;
  }
  
  @Output() closeSidebar = new EventEmitter<void>();

  constructor(private router: Router, private authService: AuthService) {
    console.log('ðŸŽ¯ Sidebar component initialized');
  }

  goToFoodie() {
    this.router.navigate(['/foodie-application']);
    this.closeSidebar.emit();
  }

  goToRestaurants() {
    alert('FunciÃ³n de restaurantes prÃ³ximamente');
    this.closeSidebar.emit();
  }

  goToAccount() {
    alert('FunciÃ³n de cuenta prÃ³ximamente');
    this.closeSidebar.emit();
  }

  doLogout() {
    this.authService.logout();
    this.router.navigate(['/login']);
    this.closeSidebar.emit();
  }
}
